import React from "react";

function About() {
  return (
    <section id="about" className="min-h-screen flex flex-col justify-center items-center text-center px-6">
      <h2 className="text-3xl font-bold text-gray-900">About Me</h2>
      <p className="text-lg text-gray-700 mt-4 max-w-2xl">
        With expertise in frontend development, UI/UX design, and backend engineering, I specialize in creating high-performance web applications.
      </p>
    </section>
  );
}

export default About;
